import "./profile.scss";
import FacebookTwoToneIcon from "@mui/icons-material/FacebookTwoTone";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import InstagramIcon from "@mui/icons-material/Instagram";
import PinterestIcon from "@mui/icons-material/Pinterest";
import TwitterIcon from "@mui/icons-material/Twitter";
import PlaceIcon from "@mui/icons-material/Place";
import LanguageIcon from "@mui/icons-material/Language";
import EmailOutlinedIcon from "@mui/icons-material/EmailOutlined";
import MoreVertIcon from "@mui/icons-material/MoreVert";
import Posts from "../../components/posts/Posts";

function Profile() {
  return (
    <div className="profile">
      <div className="images">
        <img className="cover" src="https://images.pexels.com/photos/13440765/pexels-photo-13440765.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" alt=""/>
        <img className="profile" src="https://images.pexels.com/photos/14028501/pexels-photo-14028501.jpeg?auto=compress&cs=tinysrgb&w=1600&lazy=load" alt=""/>
      </div>
      <div className="profileContainer">
        <div className="left">
          <a href="https://www.facebook.com"><FacebookTwoToneIcon fontSize="large"/></a>
          <a href="https://www.instagram.com"><InstagramIcon fontSize="large"/></a>
          <a href="https://www.twitter.com"><TwitterIcon fontSize="large"/></a>
          <a href="https://linkedin.com"><LinkedInIcon fontSize="large"/></a>
          <a href="https://pinterest.com"><PinterestIcon fontSize="large"/></a>
        </div>

        <div className="center">
          <span>Jane Doe</span>
          <div className="info">
            <div className="item">
              <PlaceIcon />
              <span>USA</span>
            </div>
            <div className="item">
              <LanguageIcon />
              <span>metime.co</span>
            </div>
            <button>Follow</button>
          </div>
        </div>

        <div className="right">
          <EmailOutlinedIcon />
          <MoreVertIcon />
        </div>                           
      </div>
    </div>
  )
}

export default Profile
